function sumImbalanceNumbers(nums: number[]): number {
    let totalImbalance = 0;
    nums.forEach((_, index) => {
        const minQueue: number[] = [];
        const maxQueue: number[] = [];
        for (let j = index; j < nums.length; j++) {
            let minPeek = minQueue[minQueue.length - 1];
            while (minQueue.length > 0 && nums[minPeek] > nums[j]) {
                minQueue.pop();
                minPeek = minQueue[minQueue.length - 1];
            }
            minQueue.push(j);

            let maxPeek = maxQueue[maxQueue.length - 1];
            while (maxQueue.length > 0 && nums[maxPeek] <= nums[j]) {
                maxQueue.pop();
                maxPeek = maxQueue[maxQueue.length - 1];
            }
            maxQueue.push(j);

            totalImbalance += maxQueue[0] - minQueue[0];
            if (minQueue[0] === j - (j - index)) minQueue.shift();
            if (maxQueue[0] === j - (j - index)) maxQueue.shift();
        }
    });
    return totalImbalance;
}
